    false,nt"url": null,nt"notes": "Acoustic doppler current profiling (ADCP)
    data was collected to describe streamflow characteristics including total streamflow,
    velocity magnitude and secondary flow structure, and backscatter intensity at 29
    cross-sections at the Myrtle Creek Bend on the Kootenai River on June 3, 2013. Each
    of the 29 cross-sections consisted of 4 transects or bank-to-bank coverage to obtain
    a representative velocity pattern. The mean daily streamflow was around 35,500 cubic
    feet per second or 1,005 cubic meters per second.",nt"owner_org": "bd2cdd5a-4d65-46c0-9937-c8381175f104",nt"extras":
